window.bookSummaryJSON = "<p><b>Rich. Ruthless. Ravishing. </b><br> Fall in love with the sinfully sexy men of The Corrupt Empire Series.<br> <br> <b><i>Corrupt Kingdom</i></b><i><br> </i><br> They say Cyrus Reed is ruthless.<br> That he rules the underworld with an iron fist. <br> <br> A criminal. A murderer. A monster. He controlled fortunes and amassed empires.<br> <br> Our paths should never have crossed, but one poker game intertwined our fate.<br> I woke up stranded on his island.<br> Trapped. Forced to play a dangerous game of hate and lust.<br> <br> He said he took me to protect me.<br> That he was saving me.<br> But who will save me from him?<br> <br> Tropes: Enemies-to-Lovers. Forced Proximity. Corrupt Banker. Kidnapping. Suspense.</p> <p><b><i>Tarnished Empire</i></b><i><br> </i><br> My plan was simple.<br> Get invited onto his yacht.<br> Find information to destroy him.<br> <br> But I wasn't prepared for Alaric Prince.<br> Dangerous and seductive, he trapped me in his gilded cage.<br> <br> He calls me Dove.<br> Easily preyed on.<br> Easily broken.<br> <br> A man that ruthless only wants to crush me.<br> I must resist the temptation to let him.<br> <br> He's my father's enemy.<br> At war with my family.<br> A danger to me.<br> <br> Falling for him would be my demise.<br> But if my plan works, it will be his.<br> <br> Tropes: Enemies-to-Lovers. Arms Dealer. Forced Proximity. Suspense.</p> <p><b><i>Ruthless Monarch</i></b><i><br> </i><br> Matteo Amante. <br> Dangerous. Deadly. And most of all, devastating. <br> <br> He’s the king of the city.<br> Running the mafia and ruling the East Coast.<br> <br> He’s at war with his cousin, and I am the casualty. <br> There is nothing Matteo won’t do to win. <br> <br> He’ll burn everything down to the ground, my hopes and dreams included.<br> <br> He’s no hero. <br> He’s the handsome devil, who will probably kill me in the end. <br> Falling in love with the enemy can destroy me, especially when he is my husband</p> <p>Tropes: Enemies-to-Lovers. Mafia Boss. Forced Proximity. Marriage of Convenience. Suspense.</p>"; 
